import React, { Component } from 'react';
import PropTypes from 'prop-types';

export default class Email extends Component {
    constructor(props) {
        super(props)
        this.state = {
            email:props.email,
        }
    }

    render() {
        return (
            <div class="boxWrapped">
                <div class="boxHolder">
                    <div class="boxSend"> from: <br />{this.state.email.sender}</div>
                    <div class="boxRec"> to: <br />{this.state.email.recipient}</div>
                </div>
                <div class="boxHolder">
                    <div class="boxSubject"> {this.state.email.subject}</div>
                    <div class="boxDate"> {this.state.email.date}</div>
                </div>
                <div class="boxBody"> {this.state.email.message}</div>
            </div>
        )
    }
}



Email.propTypes = {
    email: PropTypes.object
}
